class FABSValidator:
    def __init__(self):
        self.validation_rules = {}

    def add_validation_rule(self, rule_id, rule):
        self.validation_rules[rule_id] = rule

    def validate(self, data):
        for rule_id, rule in self.validation_rules.items():
            if not rule(data):
                return False
        return True

